# importando bibliotecas

import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
import seaborn as sns
from sklearn import datasets
from sklearn.cluster import KMeans
from sklearn.metrics import silhouette_score
from sklearn.metrics import confusion_matrix
from sklearn.metrics import accuracy_score
from sklearn.decomposition import PCA

# carrega a base de dados
iris = datasets.load_iris()  

# pega todos os rÃ³tulos
especies = [iris.target_names[i] for i in iris.target]  

# pega os rÃ³tulos como nÃºmeros [0 = setosa, 1 = versicolor, 2 = virginica]
especies_num = iris.target  

# pega as trÃªs espÃ©cies [setosa, versicolor, virginica]
especies_nome = iris.target_names

iris = pd.DataFrame(
    {
        "comprimento_sepala":iris.data[:,0], 
        "largura_sepala": iris.data[:,1],
        "comprimento_petala":iris.data[:,2], 
        "largura_petala": iris.data[:,3], 
        "especies": especies
     }
)

iris_sem_rotulos = iris.iloc[:,0:4]

iris

sns.pairplot(iris,hue='especies')

sns.relplot(
    x="comprimento_petala", # eixo x
    y="largura_petala",     # eixo y
    hue='especies',         # cor dos pontos
    data=iris               # tabela de entrada
)

kmeans = KMeans(
    n_clusters = 3,      # total de grupos 
    init = 'k-means++',  # inÃ­cio inteligente
    max_iter = 300,      # mÃ¡ximo de iteraÃ§oes
    n_init = 10,         # inicializaÃ§Ãµes para diferentes centroides
    random_state = 10.   # remove aleatoriedade
)

# realizando prediÃ§Ãµes com k-means
predicao = kmeans.fit_predict(iris_sem_rotulos)

matriz_confusao = confusion_matrix(especies_num, predicao)

print(matriz_confusao)

sns.heatmap(
    matriz_confusao, 
    annot=True, 
    cmap="Blues",  
    xticklabels=especies_nome, 
    yticklabels=especies_nome
)#, fmt='.1%')

acertos = accuracy_score(especies_num, predicao)

print("Acertos:", round(100*acertos, 2), "%")

print(predicao)

sns.relplot(
    x="comprimento_petala", 
    y="largura_petala",
    hue=predicao, 
    data=iris
)

"""## Determinando o melhor valor de K"""

sqdg = []  # Soma de quadrados dentro dos grupos 

total_testes = 15

for i in range(1, total_testes+1):
    kmeans = KMeans(
        n_clusters = i, 
        init = 'k-means++', 
        max_iter = 300, 
        n_init = 10, 
        random_state = 10
    )
    kmeans.fit(iris_sem_rotulos)
    sqdg.append(kmeans.inertia_)

plt.plot(range(1, total_testes+1), sqdg)
plt.title('MÃ©todo elbow')
plt.xlabel('NÃºmero de grupos')
plt.ylabel('Soma de quadrados dentro dos grupos') 
plt.show()

"""# AnÃ¡lise de componentes principais (PCA)"""

# Definindo o nÃºmero de componentes principais
pca = PCA(n_components = 2)

# Calculando o PCA
iris_reduzido = pca.fit_transform(iris_sem_rotulos)

# Criando um dataframe
dados_grafico = pd.DataFrame(
    iris_reduzido, 
    columns=['PCA1','PCA2']
)

# Plotando o grÃ¡fico
f = sns.relplot(
    x="PCA1", 
    y="PCA2",
    hue=especies, 
    data=dados_grafico
)

